Learning piano at the age of 5 and son to a life-long drummer, Washington D.C. based producer/DJ, Sharrol Kelby (born Alec Smith) has been surrounded by music his entire life. With roots stemming from progressive rock, hip-hop, jazz fusion, funk metal, and reggae, Smith became infatuated with several electronic artists that intermingled these genres.

Under the Sharrol Kelby moniker, Smith has since released multiple EPs, several singles and remixes, and has supported acts such as Shades (EPROM & Alix Perez), The Glitch Mob, Mr. Carmack, Tsuruda, Buku, Esseks, Emalkay, Thelem, and Mad Zach. He continues to move the Sharrol Kelby project forward with his mix of experimental hip-hop, halftime/future beats and dubstep, combined with mind-bending live edits and mixing through a custom Ableton Live setup.
